        }
       // print("inputString : \n \(inputString)\n")

       
       print("\n\n trying to convert the string to png -- inside toImage function")
       let decodedData = Data(base64Encoded: todecode, options: [])
        if decodedData != nil{
            print("success!! returning u=UIImage")
